import { Row, Col, Card } from "react-bootstrap";

const BugItem = ({ bug }) => {
  return
  <Card>
    <Card.Header>
      <Row>
        <Col>bug.id</Col>
      </Row>
    </Card.Header>
  </Card>;
};

export default BugItem;
